module.exports = "<byt-nav></byt-nav>\n<br>\n<section class=\"container\">\n\t<section class=\"col-md-6 col-md-offset-3 byt_background\">\n\t\t<section class=\"row byt_intro\">\n\t\t\t<a id=\"byt-left-arrow\" routerLink=\"../byt-edu-credit-card-2\" class=\"glyphicon glyphicon-arrow-left\"></a>\n\t\t\t<a id=\"byt-right-arrow\" routerLink=\"../byt-edu-credit-card-4\" class=\"pull-right glyphicon glyphicon-arrow-right\"></a>\n\t\t\t<section class=\"byt_question row\">\n\t\t\t\tGenerally, what is a credit card cash advance?\n\t\t\t</section>\n\t\t\t<section *ngIf=\"AnswerChoice1\" class=\"byt_gif_1 row\">\n\t\t\t\t<iframe style=\"margin-left: 28px\" src=\"https://giphy.com/embed/3otPoumTG9VHMQlIPu\" width=\"240\" height=\"120\" frameBorder=\"0\" class=\"giphy-embed\"></iframe>\n\t\t\t\t<section class=\"alert alert-success\" role=\"alert\" style=\"margin-right: 48px; margin-left: 40px; margin-bottom: 0px\">\n\t\t\t\t\tYou got it!  Also, purchasing lottery tickets, casino gaming chips, race track wagers or similar betting transactions may also be considered cash advances. Making a payment using third-party services may also be considered a cash advance. Many people are surprised to learn that purchasing lottery tickets on a credit card is the same as making a cash advance. The main reason is that compulsive gamblers could accumulate unmanageable debt. Therefore, due to the increased risk, banks charge higher rates to protect themselves.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section *ngIf=\"AnswerChoice2\" class=\"byt_gif_2 row\">\n\t\t\t\t<iframe src=\"https://giphy.com/embed/EaxciIRvOziSY\" width=\"240\" height=\"120\" frameBorder=\"0\" class=\"giphy-embed\"></iframe>\n\t\t\t\t<section class=\"alert alert-danger\" role=\"alert\" style=\"margin-right: 48px; margin-left: 12px; margin-bottom: 0px\">\n\t\t\t\t\tNo no. A purchase of a good or service is not a cash advance. Most goods or services are considered normal purchases and carry lower rates.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section *ngIf=\"AnswerChoice3\" class=\"byt_gif_3 row\">\n\t\t\t\t<iframe src=\"https://giphy.com/embed/l0HlP8UutaaPsauFa\" width=\"240\" height=\"120\" frameBorder=\"0\" class=\"giphy-embed\"></iframe>\n\t\t\t\t<section class=\"alert alert-danger\" role=\"alert\" style=\"margin-right: 48px; margin-left: 12px; margin-bottom: 0px\">\n\t\t\t\t\tClose, but no. Although a cash withdrawal is considered a cash advance, a cash withdrawal is not the only type of transaction that can be considered a cash advance.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section *ngIf=\"AnswerChoice4\" class=\"byt_gif_4 row\">\n\t\t\t\t<iframe style=\"margin-left: -27px\" src=\"https://giphy.com/embed/l0OXWXUHdp4K9nitq\" width=\"240\" height=\"120\" frameBorder=\"0\" class=\"giphy-embed\"></iframe>\n\t\t\t\t<section class=\"alert alert-danger\" role=\"alert\" style=\"margin-right: 48px; margin-left: 12px; margin-bottom: 0px\">\t\t\t\t\t\n\t\t\t\t\tNope. A balance transfer and a cash advance are two different things. \n\t\t\t\t</section>\n\t\t\t</section>\n\n\t\t\t<section class=\"row\" style=\"margin-left: 0px;\">\n\t\t\t\t<section class=\"byt_potential_answer_1\">\n\t\t\t\t\t<input style=\"cursor:pointer;\" type=\"checkbox\" [checked]=\"SomeVar1\" (click)=\"SomeFunction1()\">\n\t\t\t\t</section>\n\t\t\t\t<section class=\"byt_potential_answer_text_1\">\n\t\t\t\t\tA cash advance is any cash withdrawal from a credit account or any purchase of travelers checks, foreign currency, money orders, wire transfers or similar cash-like items.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section class=\"row\" style=\"margin-left: 0px;\">\n\t\t\t\t<section class=\"byt_potential_answer_2\">\n\t\t\t\t\t<input style=\"cursor:pointer;\" type=\"checkbox\" [checked]=\"SomeVar2\" (click)=\"SomeFunction2()\">\n\t\t\t\t</section>\n\t\t\t\t<section class=\"byt_potential_answer_text_2\">\n\t\t\t\t\tAny purchase of a good or service such as food or cable tv.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section class=\"row\" style=\"margin-left: 0px;\">\n\t\t\t\t<section class=\"byt_potential_answer_3\">\n\t\t\t\t\t<input style=\"cursor:pointer;\" type=\"checkbox\" [checked]=\"SomeVar3\" (click)=\"SomeFunction3()\">\n\t\t\t\t</section>\n\t\t\t\t<section class=\"byt_potential_answer_text_3\">\n\t\t\t\t\tA cash advance only takes place when physical cash is withdrawn.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section class=\"row\" style=\"margin-left: 0px;\">\n\t\t\t\t<section class=\"byt_potential_answer_4\">\n\t\t\t\t\t<input style=\"cursor:pointer;\" type=\"checkbox\" [checked]=\"SomeVar4\" (click)=\"SomeFunction4()\">\n\t\t\t\t</section>\n\t\t\t\t<section class=\"byt_potential_answer_text_4\">\n\t\t\t\t\tA cash advance occurs when you transfer a balance from another credit account.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<br>\n\t\t\t<button (click)=\"submitAnswerFunc()\" class=\"btn btn-default btn-lg byt_intro_message_button pull-right\">Submit</button>\n\t\t</section>\n\t\t<br>\t\t\n\t</section>\n</section>\n<byt-direct-link></byt-direct-link>"

