module.exports = "<byt-nav></byt-nav>\n<br>\n<section class=\"container\">\t\n\t<section class=\"col-md-6 col-md-offset-3 byt_background\">\n\t\t<section class=\"row byt_intro\">\n\t\t\t<a id=\"byt-left-arrow\" routerLink=\"../byt-edu-stocks-5\" class=\"glyphicon glyphicon-arrow-left\"></a>\n\t\t\t<a id=\"byt-right-arrow\" routerLink=\"../byt-edu-stocks-7\" class=\"pull-right glyphicon glyphicon-arrow-right\"></a>\n\t\t\t<section class=\"byt_question row\">\n\t\t\t\tWhat ratio can best give an investor a sense of value? In other words, what ratio can an investor calculate and analyze in order to understand if a stock is cheap or expensive?\n\t\t\t</section>\n\t\t\t<section *ngIf=\"AnswerChoice1\" class=\"byt_gif_1 row\">\n\t\t\t\t<iframe style=\"margin-left: 0px\" src=\"https://giphy.com/embed/l0OXWXUHdp4K9nitq\" width=\"240\" height=\"120\" frameBorder=\"0\" class=\"giphy-embed\"></iframe>\n\t\t\t\t<section class=\"alert alert-danger\" role=\"alert\" style=\"margin-right: 48px; margin-left: 40px; margin-bottom: 0px\">\n\t\t\t\t\tNope. An initial public offering is generally not a measure of value. An IPO takes place when a company wants to sell shares to the public in order to raise capital for expansion or in order for insiders to gain liquidity.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section *ngIf=\"AnswerChoice2\" class=\"byt_gif_2 row\">\n\t\t\t\t<iframe src=\"https://giphy.com/embed/3otPoumTG9VHMQlIPu\" width=\"240\" height=\"120\" frameBorder=\"0\" class=\"giphy-embed\"></iframe>\n\t\t\t\t<section class=\"alert alert-success\" role=\"alert\" style=\"margin-right: 48px; margin-left: 12px; margin-bottom: 0px\">\n\t\t\t\t\tHallelujah!!!! You are correct :) The price to earnings ratio is a measure of value as it give investors a sense of how expensive or cheap a company's earnings (profits) are.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section *ngIf=\"AnswerChoice3\" class=\"byt_gif_3 row\">\n\t\t\t\t<iframe src=\"https://giphy.com/embed/l0HlP8UutaaPsauFa\" width=\"240\" height=\"120\" frameBorder=\"0\" class=\"giphy-embed\"></iframe>\n\t\t\t\t<section class=\"alert alert-danger\" role=\"alert\" style=\"margin-right: 48px; margin-left: 12px; margin-bottom: 0px\">\n\t\t\t\t\tNah. Price per share is a calculation but it is not a measure of value.\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section *ngIf=\"AnswerChoice4\" class=\"byt_gif_4 row\">\n\t\t\t\t<iframe style=\"margin-left: 0px\" src=\"https://giphy.com/embed/EaxciIRvOziSY\" width=\"240\" height=\"120\" frameBorder=\"0\" class=\"giphy-embed\"></iframe>\n\t\t\t\t<section class=\"alert alert-danger\" role=\"alert\" style=\"margin-right: 48px; margin-left: 12px; margin-bottom: 0px\">\t\t\t\t\t\n\t\t\t\t\tNo cigar. Debt to equity is a calculation but it gives investors a sense of a company's capital structure as opposed to a sense of value.\n\t\t\t\t</section>\n\t\t\t</section>\n\n\n\t\t\t<section class=\"row\" style=\"margin-left: 0px;\">\n\t\t\t\t<section class=\"byt_potential_answer_1\">\n\t\t\t\t\t<input style=\"cursor:pointer;\" type=\"checkbox\" [checked]=\"SomeVar1\" (click)=\"SomeFunction1()\">\n\t\t\t\t</section>\n\t\t\t\t<section class=\"byt_potential_answer_text_1\">\n\t\t\t\t\tInitial public offering (IPO)\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section class=\"row\" style=\"margin-left: 0px;\">\n\t\t\t\t<section class=\"byt_potential_answer_2\">\n\t\t\t\t\t<input style=\"cursor:pointer;\" type=\"checkbox\" [checked]=\"SomeVar2\" (click)=\"SomeFunction2()\">\n\t\t\t\t</section>\n\t\t\t\t<section class=\"byt_potential_answer_text_2\">\n\t\t\t\t\tPrice to earnings\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section class=\"row\" style=\"margin-left: 0px;\">\n\t\t\t\t<section class=\"byt_potential_answer_3\">\n\t\t\t\t\t<input style=\"cursor:pointer;\" type=\"checkbox\" [checked]=\"SomeVar3\" (click)=\"SomeFunction3()\">\n\t\t\t\t</section>\n\t\t\t\t<section class=\"byt_potential_answer_text_3\">\n\t\t\t\t\tPrice per share\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<section class=\"row\" style=\"margin-left: 0px;\">\n\t\t\t\t<section class=\"byt_potential_answer_4\">\n\t\t\t\t\t<input style=\"cursor:pointer;\" type=\"checkbox\" [checked]=\"SomeVar4\" (click)=\"SomeFunction4()\">\n\t\t\t\t</section>\n\t\t\t\t<section class=\"byt_potential_answer_text_4\">\n\t\t\t\t\tDebt to equity\n\t\t\t\t</section>\n\t\t\t</section>\n\t\t\t<br>\n\t\t\t<button (click)=\"submitAnswerFunc()\" class=\"btn btn-default btn-lg byt_intro_message_button pull-right\">Submit</button>\n\t\t</section>\n\t\t<br>\t\t\n\t</section>\n</section>\n<byt-direct-link></byt-direct-link>"

